import React from "react";

import "./LandingPage.css";

const LandingPage = () => {
  return (
    <div className="landing-container">
      <div className="background-image-landing">
        <img className='landing-image' src="https://images.unsplash.com/photo-1506744038136-46273834b3fb?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=1470&q=80" alt="musician playing guitar on stage with crowd" />
      </div>
      <h1 id="welcome-text">
        Welcome to Medley, a place where you can upload a favorite musician(s), along with their music.
        Navigate to your profile page to upload your favorite musicians mp3 and other audio files you would like to showcase.
        Easily access all of your musicians by navigating to your profile page and choosing your desired artist.
      </h1>

    </div>
  );
};
export default LandingPage;
